package eduJavaCode;

public class DebuggingCode {
	
	static void add()
	{
		System.out.println("Addition");
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int d;
		int e;
		int f;
		
		add();
		
		d = 10;
		System.out.println(d);
		e = 20;
		System.out.println(e);
		f = 30;
		System.out.println(f);
		
		d = 70;
		System.out.println(d);
		e = 80;
		System.out.println(e);
		f = 90;
		System.out.println(f);

	}

}
